// Home.js
import React, { useEffect } from 'react';
import styled from 'styled-components';
import pic from './assets/cat.jpeg';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100%; /* Let the content take up the entire height */
`;

const Home = ({ updateContentHeight }) => {
  useEffect(() => {
    // Adjust the content height on mount (similar to componentDidMount)
    updateContentHeight('calc(100vh - 60px)'); // Adjust the height according to your layout
    // Clean up the effect (similar to componentWillUnmount)
    return () => {
      updateContentHeight('auto'); // Reset the height on unmount
    };
  }, [updateContentHeight]);

  return (
    <HomeContainer>
      <h2>Welcome to My Website</h2>
      <img src={pic} alt="Cute Cat" />
      <p>Roxana Halati (like the city Galati but with H)</p>
      <p>Assistant PhD</p>
      <p>UBB FMI</p>
      <p>Email: example@example.com</p>

      <div>
        <p>
          Hi there! Thank you for visiting my website. Lorem Ipsum Dolor Sit Amet, consectetur adipiscing elit. Sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation
          ullamco laboris nisi ut aliquip ex ea commodo consequat.
        </p>
      </div>
    </HomeContainer>
  );
};

export default Home;
